import logo from './logo.svg';


function NavBar() {
  return (
    <div className="NavBar">
    <nav>
      <ul>
        <li>Home</li>
        <li>News</li>
        <li>Contact</li>
        <li>About</li>
      </ul>
    </nav>
    </div>
  );
}

export default NavBar;
